import React from 'react';

function Footer() {
  return (
    <footer className="footer mt-auto py-3 bg-light">
      <div className="container">
        <span className="text-muted">Joaquin Becerra - Gonzalo Ruiz - Bautista Pigni</span>
      </div>
    </footer>
  );
}

export default Footer;
